import React from 'react';

export default function ToggleSlider() {

    return (
        <div className="toggleContainer">
        <label class="switch">
        <input type="checkbox"/>
        <span class="slider round"></span>
      </label>
      
      <label class="switch">
        <input type="checkbox" checked/>
        <span class="slider round"></span>
      </label>
	</div>
    );

}
